import React from "react";
import "./rainbow-button.css";

export function RainbowButton({ children, style = {}, ...props }) {
  return (
    <button
      className="simple-rainbow-btn"
      style={style}
      {...props}
    >
      {children}
    </button>
  );
}

export function RainbowButtonDemo() {
  return <RainbowButton>Try for free!</RainbowButton>;
}
